import * as React from "react";
import { Box, Typography, Card, CardContent } from "@mui/material";

export default function HairPage() {
  // Example array of venue names and descriptions
  const venues = [
    { name: "Venue 1", description: "Short description of Venue 1" },
    { name: "Venue 2", description: "Short description of Venue 2" },
    { name: "Venue 3", description: "Short description of Venue 3" },
    { name: "Venue 4", description: "Short description of Venue 4" },
    { name: "Venue 5", description: "Short description of Venue 5" },
    { name: "Venue 6", description: "Short description of Venue 6" },
    { name: "Venue 7", description: "Short description of Venue 7" },
    { name: "Venue 8", description: "Short description of Venue 8" },
    { name: "Venue 9", description: "Short description of Venue 9" },
    { name: "Venue 10", description: "Short description of Venue 10" },
  ];

  return (
    <Box
      sx={{
        width: "100%",
        height: "100vh",
        display: "flex",
        flexDirection: "column", // Stack the boxes vertically
        alignItems: "center",
        justifyContent: "center",
        backgroundColor: "#f5f5f5",
        padding: 2,
        overflowY: "auto", // Allow scrolling if content exceeds screen height
      }}
    >
      {/* Header */}
      <Typography
        variant="h3"
        sx={{
          fontWeight: "bold",
          marginBottom: 3,
          textAlign: "center",
        }}
      >
        Welcome to the Venues Page
      </Typography>

      {/* Render each venue */}
      {venues.map((venue, index) => (
        <Card
          key={index}
          sx={{
            width: "80%", // Adjust width as needed
            marginBottom: 2, // Space between boxes
            backgroundColor: "transparent", // Make background transparent
            border: "1px solid #ccc", // Border around the boxes
            borderRadius: 2,
            boxShadow: "0px 4px 6px rgba(0, 0, 0, 0.1)",
            padding: 2,
          }}
        >
          <CardContent>
            <Typography variant="h6" fontWeight="bold">
              {venue.name}
            </Typography>
            <Typography variant="body2" color="text.secondary">
              {venue.description}
            </Typography>
          </CardContent>
        </Card>
      ))}
    </Box>
  );
}


